import './App.css';
import { AuthProvider } from './context/AuthContext';
import HomePage from './pages/HomePage'
import { BrowserRouter } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <AuthProvider>
          <HomePage />
        </AuthProvider>
      </BrowserRouter>
    </div>
  );
}

export default App;
